import React from "react";
import TopBar from "..";
import TopBarAuth from "../TopBarAuth";
import EmptyComponent from "../../EmptyComponent";

function TopBarHome() {
  const ResultComponent = TopBar(EmptyComponent, TopBarAuth);
  return <ResultComponent />;
}

export default TopBarHome;
